    public static long taskSchedulerII(int[] tasks, int space) {
        HashSet<Integer> values = new HashSet<>();
        for(int i=0; i<tasks.length; i++){
            values.add(tasks[i]);
        }
        Integer[] valuesArray = new Integer[values.size()];
        Integer[] valuesCountArray = new Integer[values.size()];
        values.toArray(valuesArray);
        //Map<Integer,Integer> taskMap = new HashMap<>();
        //taskMap.put(tasks[0],0);
        //log.info(tasks.length+"");
        //log.info(valuesArray.length+"");
        //log.info(valuesCountArray.length+"");
        long count = 0;
        for(int i=1; i<tasks.length; i++){
            int nowIndex = -1;
            for (int k=0; k<valuesArray.length; k++) {
                if(tasks[i]==valuesArray[k]){
                    nowIndex = k;
                }
            }
            Integer nowCount = valuesCountArray[nowIndex];
            if(nowCount!=null && nowCount<space){//距离上一次时间不够
                //需要休息的天数
                int sleep = space - nowCount;
                count += sleep;
                //休息够了，所有任务都增加天数
                for (int k=0; k<valuesArray.length; k++) {
                    if(valuesCountArray[k]!=null){
                        valuesCountArray[k] += sleep;
                    }
                }
            }
            //做任务
            //所有任务加1天
            for (int k=0; k<valuesArray.length; k++) {
                if(valuesCountArray[nowIndex]!=null){
                    valuesCountArray[nowIndex] ++;
                }
            }
            //当前任务
            valuesCountArray[nowIndex]=0;
        }

        count += tasks.length;
        return count;
    }
